                    `,illustration:"/images/projects/yournight.png"},{element:"Ralisations lies",content:"YourNight, PREMIS DM, ISIS, Hypotech"}]},{name:"Git",icon:"img/skillsIcon/Git.svg",percentageOfMastery:90,category:"technical",explanation:[{element:"Dfinition",content:`
